Paranatural

Science Documentary hosted by Anato Yusef, published by National Geographic in 2013 - English narration


Information
------------------------------

Paranatural 
Paranatural presents stunning revelations and provocative theories that further fuel debate around seemingly supernatural activities. Dramatic and scary, these supernatural tales of enduring mysteries and unimaginable phenomena are enticing with their intrigue. Paranatural assembles evidence featuring eyewitness commentary and expert testimony from some of the brightest research and investigative minds.




2)  Monsters of the Deep 
From Loch Ness to the west coast of Canada, people are reporting sightings of creatures they can't explain. Are they seeing something Paranatural?

3)  Doomsday Prophecies 
For ages, prophets have suggested that disastrous events and maybe even the end of the world lie ahead.

4)  Bigfoot Encounters 
Bigfoot. Sasquatch. Abominable Snowman. Yeti. No matter what you call it, these large, hair-covered creatures that walk upright like humans have been spotted around the world.

5)  Life after Life 
What happens when we die? Is there an afterlife? Does consciousness survive physical death? These are some of the most baffling questions known to us

6)  The Haunted 
In every culture and for centuries, witnesses report strange encounters with apparitions, or ghosts. Are they merely figments of wild imaginations?

7)  Alien Encounters 
Are UFOs signs of intelligent life outside our planet, or are they just natural or man-made phenomena that some mistake for something otherworldly?

8)  Animal Apocalypse 
Why are we seeing mass animal die-offs around the world? Scientists are searching for answers, and studying why some species are beginning to vanish.

9)  Crop Circles 
Across the planet thousands of crop circles have been reported. Is there any chance crop circles are messages from another world?

10)  Psychic Powers 
In New Jersey a girl is killed and a psychic claims she can see her murderer. In Oregon, a psychic tries to help solve the slaying of a cowboy.

